import React from 'react';
import { Defaultmargin } from '../../pages/Default/styles';
import { Title, Text, Container } from './style';
interface Props{
    title: string;
    text:string;
    
  }

const Projeto:React.FC<Props> = ({title, text}) =>{
    return (  
        <Container>
           <Defaultmargin><Title>
                {title}
           </Title>
           </Defaultmargin>
           <Text>
                {text}
           </Text>

        </Container>
    );
}

export default Projeto;
